class Queue:
    def __init__(self):
        self.front = None
        self.back = None

    def enqueue(self, item):
        if self.front is None:
            self.front = item
            self.back = item
        else:
            self.back.next = item
            self.back = item

    def dequeue(self):
        if self.front is None:
            raise Exception("Queue is empty")
        item = self.front
        self.front = self.front.next
        return item
```

